import React from "react";

const MachineTable = ({ list }) => {
  return (
    <table>
      <thead>
        <tr> 
          <th>Name</th>
		</tr>
      </thead>
      <tbody>
        { (list.length > 0) ? list.map( (list, index) => {
           return (
            <tr key={ index }>
              <td>{ list.name }</td>
			</tr>
          )
         }) : <tr><td colSpan="5">Loading...</td></tr> }
      </tbody>
    </table>
  );
}

export default MachineTable;
